function affiche(idbox,idmsg) {
			var box=document.getElementById(idbox);
			var msg=document.getElementById(idmsg);
			var ribs=document.getElementsByName('SepaNbIban')[0].value;

			if (box.checked==true) {
				document.getElementById('div_SepaShowAddRib').style.display='none';
				if (ribs != 0) {
					var mt_payer=window.document.getElementsByName('SepaTotalMontant')[0].value;
					if (0 != mt_payer) {
						alert("Vous optez pour le paiement par carte bancaire. Le montant du télépaiement préalablement affiché a été remis à zéro. Aucun télépaiement ne sera présenté à votre banque.");
					}
				}
				if (document.all) {
					msg.style.removeAttribute('height');
					msg.style.removeAttribute('display');
				}
				else {
					msg.style.height='';
					msg.style.display='';
				}

				if (0 ==  ribs) {
					var info=document.getElementById('info_tele');

					info.style.height='10px';
					info.style.display='none';
				}
